import React from 'react'
import PropTypes from 'prop-types';

export default function Login() {
  return (
    <nav className='login'>
      <h2>Inventory Login</h2>
      <p>Sign in to manage your store's inventory</p>
      <button className='github' onClick={() => props.authenticate('Github')}>Log In With Github</button>
      <button className='github' onClick={() => props.authenticate('Facebook')}>Log In With Facebook</button>
      <button className='github' onClick={() => props.authenticate('Twitter')}>Log In With Twitter</button>
    </nav>
  )
}


Login.propTypes = {
  authenticate: PropTypes.func.isRequired
}
